def solution(pattern: list[list[str]])-> int:
    res = 0
    to_remove = []
    for i in range(len(pattern)):
        for j in range(len(pattern[i])):
            if pattern[i][j] != "@":
                continue
            count_role = 0
            if i != 0 and pattern[i - 1][j] == "@":
                count_role += 1
            if j != 0 and pattern[i][j - 1] == "@":
                count_role += 1
            if j + 1 < len(pattern[i]) and pattern[i][j + 1] == "@":
                count_role += 1
            if i + 1 < len(pattern) and pattern[i + 1][j] == "@":
                count_role += 1
            if (i - 1 >= 0 and j - 1 >= 0) and pattern[i - 1][j - 1] == "@":
                count_role += 1
            if (i - 1 >= 0 and j + 1 < len(pattern[i])) and pattern[i - 1][j + 1] == "@":
                count_role += 1
            if (i + 1 < len(pattern) and j - 1 >= 0) and pattern[i + 1][j - 1] == "@":
                count_role += 1
            if (i + 1 < len(pattern) and j + 1 < len(pattern[i])) and pattern[i + 1][j + 1] == "@":
                count_role += 1
            if count_role < 4:
                to_remove.append((i, j))
    for i, j in to_remove:
        pattern[i][j] = "."
        res += 1
    return res
def main_solution(pattern: list[list[str]])-> int:
    res = 0
    while True:
        removed = solution(pattern)
        if removed == 0:
            break
        res += removed
    return res

